import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import { Link as RouterLink } from 'react-router-dom';

const Navbar = () => (
  <AppBar position="static" color="default" elevation={1}>
    <Toolbar>
      <Typography variant="h6" sx={{ flexGrow: 1, fontWeight: 'bold' }}>
        GoGetWell AI
      </Typography>
      <Box>
        <Button component={RouterLink} to="/" color="inherit">Home</Button>
        <Button component={RouterLink} to="/features" color="inherit">Features</Button>
        <Button component={RouterLink} to="/pricing" color="inherit">Pricing</Button>
        <Button component={RouterLink} to="/about" color="inherit">About</Button>
        <Button component={RouterLink} to="/contact" color="inherit">Contact</Button>
      </Box>
    </Toolbar>
  </AppBar>
);

export default Navbar;
